import sys

def main():
    num_participants = int(sys.stdin.readline())
    camp_info = [int(x) for x in sys.stdin.readline().split()]
    num_days = camp_info[0]
    remaining_chocolate = camp_info[1]
    participants = []
    for i in range(num_participants):
        participants.append(int(sys.stdin.readline()))
    prepared_chocolate = remaining_chocolate
    for i in range(1, num_days + 1):
        for j in participants:
            if i % (j + 1) == 0:
                prepared_chocolate += 1
    print(prepared_chocolate)

if __name__ == "__main__":
    main()

