from collections import defaultdict
from typing import List

def main():
    n = int(input())
    d, x = map(int, input().split())
    a = list(map(int, input().split()))

    # 日付ごとに何個残ったかを計算
    date_dict = defaultdict(int)
    for i in range(n):
        for j in range(d):
            if (j + 1) % (a[i] + 1) == 0:
                date_dict[j + 1] += 1

    # 日付ごとに何個残ったかから消費数を計算
    # 消費数から残り数を引くと、合計数がわかる
    for i in range(d):
        x -= (date_dict[i + 1] - 1)

    print(x)

if __name__ == '__main__':
    main()
